  int get hashCode => name.hashCode ^ nodes.hashCode ^ wires.hashCode;

  @override
  bool operator ==(Object other) =>
      identical(this, other) ||
      other is NodeNetworkView &&
          runtimeType == other.runtimeType &&
          name == other.name &&
          nodes == other.nodes &&
          wires == other.wires;
}

